import ListItem from "./comp_listItem/listItem_comp";
const List = ({todos}) =>{
    console.log(todos)
    return(
        <ul>
            {
                todos.map(todo => <ListItem todoName={todo} key={todo.id}/>)
            }
        </ul>
    )
}

export default  List;
